package core

import "encoding/hex"

var (
	sk  = "819da5fa6489428f9b95780d5f5d740d651b50e21c99b33101eceeb37a5c8850"
	iv  = "f9e02e9fce1a498a34b08e67"
	pub = ""
)

func skb() []byte {
	d, _ := hex.DecodeString(sk)
	return d
}

func ivb() []byte {
	d, _ := hex.DecodeString(iv)
	return d
}
